import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import React from 'react';
import ReactDOM from 'react-dom/client';

// Importing route components
import Root from './routes/root';
import DetailPage from './routes/details';
import FAQPagel from './routes/userFAQ';
import Index from './routes/index';
import Search from './routes/search';

import './css/index.css';

/*
ITP 404, Midterm
Author: Carson Wang
Email: carsonw@usc.edu
Create router, loader for react-router-dom
*/


// Create the router with route configurations
const router = createBrowserRouter([
  {
    path: '/',
    element: <Root />,
    children: [
      {
        path: '/',
        element: <Index />,
      },
      {
        path: '/SkiResorts',
        element: <DetailPage />,
        loader: async () => {
          const url = 'https://ski-resorts-and-conditions.p.rapidapi.com/v1/resort/whistler-blackcomb';
          const options = {
            method: 'GET',
            headers: {
              'X-RapidAPI-Key': 'e16e2fc1e8mshed37f9d4a50d4b2p157a7djsn6d9372938dcf',
              'X-RapidAPI-Host': 'ski-resorts-and-conditions.p.rapidapi.com'
            }
          };

          try {
            const response = await fetch(url, options);
            const result = await response.json();
            console.log(result.data.data);
            return result.data.data;
          } catch (error) {
            console.error(error);
          }
        },
      },
    ]
  }
]);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>
);
